// ProjectForm.js
import React, { useState } from "react";
import {
  CFormFloating,
  CFormInput,
  CFormLabel,
  CFormTextarea,
  CFormCheck,
  CFormSelect,
  CInputGroup,
  CButton
} from '@coreui/react';

function ProjectForm({ saveProject, closeModal, teacherId }) {
  const [projectName, setProjectName] = useState("");
  const [projectDescription, setProjectDescription] = useState("");
  const [projectType, setProjectType] = useState("");
  const [projectDomain, setProjectDomain] = useState("");
  const [cgpaCutoff, setCGPACutoff] = useState("");
  const [prerequisites, setPrerequisites] = useState([]);
  const [newPrerequisite, setNewPrerequisite] = useState("");

  const handleAddPrerequisite = () => {
    if (newPrerequisite.trim() !== "") {
      setPrerequisites([...prerequisites, newPrerequisite]);
      setNewPrerequisite("");
    }
  };

  const handleDeletePrerequisite = (index) => {
    const updatedPrerequisites = [...prerequisites];
    updatedPrerequisites.splice(index, 1);
    setPrerequisites(updatedPrerequisites);
  };

  const handleSaveProject = () => {
    const projectData = {
      teacherId, // Include teacherId in projectData
      projectName,
      projectDescription,
      projectType,
      projectDomain,
      cgpaCutoff,
      prerequisites,
    };
    saveProject(projectData);
    closeModal();
  };

  return (
    <div>
      <h2>Add Project</h2>
      <form>
          <CFormInput
            type="text"
            value={projectName}
            id="floatingInput" floatingClassName="mb-3" floatingLabel="Project Name" placeholder="name@example.com" 
            onChange={(e) => setProjectName(e.target.value)}
          />
        <br />
          <CFormTextarea
            id="floatingTextarea"
            floatingLabel="Description"
            placeholder="Enter Project Description here"
            value={projectDescription}
            onChange={(e) => setProjectDescription(e.target.value)}
          >
          </CFormTextarea>
        <br />
        <CFormLabel htmlFor="basic-url">Your vanity URL</CFormLabel>
          <CFormCheck
            type="radio"
            value="LOP"
            label="Lab Project (LOP)"
            checked={projectType === "LOP"}
            onChange={(e) => setProjectType(e.target.value)}
          />
          <CFormCheck
            type="radio"
            value="DOP"
            label="Design Project (DOP)"
            checked={projectType === "DOP"}
            onChange={(e) => setProjectType(e.target.value)}
          />
          <CFormCheck
            type="radio"
            value="SOP"
            label="Study Project (SOP)"
            checked={projectType === "SOP"}
            onChange={(e) => setProjectType(e.target.value)}
          />
        <br />
          <CFormInput
            type="text"
            id="floatingInput" floatingClassName="mb-3" floatingLabel="Specify Domain" placeholder="name@example.com" 
            value={projectDomain}
            onChange={(e) => setProjectDomain(e.target.value)}
         />
          <CFormSelect 
          id="floatingInput" floatingLabel="CGPA cutoff" placeholder="name@example.com"
            value={cgpaCutoff}
            onChange={(e) => setCGPACutoff(e.target.value)}
            options={[
              '',
              { label: '6.0 or More', value: '6.0' },
              { label: '7.0 or More', value: '7.0' },
              { label: '8.0 or More', value: '8.0' },
              { label: '9.0 or More', value: '9.0' }
            ]}
            />
        <br />
        <CInputGroup className="mb-3">
        <CFormInput 
        type="text"
        value={newPrerequisite} 
        onChange={(e) => setNewPrerequisite(e.target.value)}
        id="floatingInput" floatingClassName="mb-3" floatingLabel="Email address" placeholder="name@example.com"
        // placeholder="Recipient's username" 
        // aria-label="Recipient's username" 
        aria-describedby="button-addon2"
        /> 
          <CButton type="button" color="secondary" variant="outline" id="button-addon2" onClick={handleAddPrerequisite}>
            Add New
            </CButton>
        </CInputGroup>
        <ul>
          {prerequisites.map((item, index) => (
            <li key={index}>
              {item}
              <button type="button" onClick={() => handleDeletePrerequisite(index)}>
                X
              </button>
            </li>
          ))}
        </ul>
        <button type="button" onClick={handleSaveProject}>
          Save
        </button>
        <button onClick={closeModal}>Cancel</button>
      </form>
    </div>
  );
}

export default ProjectForm;
